import "../bootstrap.css";
import { useEffect, useState } from "react";

const pathImagMoreInfo = "../Images/more-info.jpg";

function Professors() {
  const [laoding, setLoading] = useState(false);
  const [professors, setProfessors] = useState([]);

  useEffect(() => {
    setLoading(true);

    //  let url = 'https://jsonplaceholder.typicode.com/users';
    let url = "http://localhost:8080/professors";

    fetch(url)
      .then((response) => {
        response.json().then((result) => {
          console.log(response);
          setProfessors(result);
        });
      })
      .finally(() => {
        setLoading(false);
      });
  }, []);

  return (
    <div className="container">
      All professors...
      {laoding && <div> loading..... </div>}
      <table class="table table-bordered">
        <thead>
          <tr>
            <th scope="col">Firstname</th>
            <th scope="col">Lastname</th>
            <th scope="col">Sex</th>
            <th scope="col">Academic title</th>
            <th scope="col">More info</th>
          </tr>
        </thead>
        <tbody>
          {professors.map((e, i) => (
            <tr key={i}>
              <td scope="row">{e.firstname}</td>
              <td scope="row">{e.lastname}</td>
              <td scope="row">{e.sex === "M" ? "Man" : "Woman"}</td>
              <td scope="row">{e.academicTitle}</td>
              <td scope="row">
                <img src={require(pathImagMoreInfo)} alt="More info" />
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Professors;
